import './App.css';
import Home from "./Components/Home";
import Sidenav from './Components/sidenav';

import {
  BrowserRouter as Router,
  Routes,
  Route,
} from "react-router-dom";

import {AveryMacadamia, AveryAir} from "./pages/Avery";

function App() {
  return (
      <Router>

          <Sidenav />
          <Routes>
              <Route exact path = "/" element={<Home />} />
              <Route path="/AveryMacadamia" element={<AveryMacadamia />} />
          </Routes>
      </Router>
  );
}

export default App;
